import React from "react";
import Records from "../ asset/Records.json";

import { Box, Container, Grid, List } from "@mui/material";
import { styled } from "@mui/material";

const Niti = styled("div")((theme) => ({}));

function Home() {
  return (
    <>
      <Container>
        <Grid container>
          <Grid item xs={12} sm={6}>
            <Niti>MANAGEMENT & SERVICES COMPANY</Niti>
          </Grid>
        </Grid>
        <div className="logo">
          {Records &&
            Records.map((rec) => {
              return (
                <div key={rec.id}>
                  <img src={rec.img} alt="" />
                </div>
              );
            })}
        </div>
      </Container>
    </>
  );
}

export default Home;
